import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import TruckCard from "./TruckCard";


function TruckTable() {
    const list = []

    for (let i = 0; i < 8; i++) {
        list.push(<TruckCard/>)
    }
    return (
        <div style={{display: 'inline-table'}}>
            {list}
        </div>
    );
}

export default TruckTable;
